import './App.css';
import Form from './components/login/Form';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate
} from "react-router-dom";
import Sign from './components/sign-up/Sign';
function App() {
  return (
    <Router>
    <Routes>
    <Route  path="/" element={ <Form/>}/>
    <Route  path="sign_up" element={ <Sign/>}/>
    </Routes>
    </Router>
  );
}

export default App;
